const {
  AccountCircle,
  HomeRounded,
  PhoneAndroidRounded,
} = require("@material-ui/icons");
const { default: InputCustomize } = require("./components/InputCustomize");

export const structure = [
  {
    section: "Infomation",
    fields: [
      {
        name: "fistName",
        title: "First Name",
        grid: 6,
        component: () => (
          <InputCustomize title="First Name" icon={() => <AccountCircle color="primary" />} />
        ),
      },
      {
        name: "lastName",
        title: "Last Name",
        grid: 6,

        component: () => (
          <InputCustomize title="Last Name" icon={() => <AccountCircle color="primary" />} />
        ),
      },
      {
        name: "age",
        title: "Age",
        grid: 6,
        component: () => (
          <InputCustomize title="Age" icon={() => <AccountCircle color="primary" />} />
        ),
      },
    ],
  },
  {
    section: "Contact",
    fields: [
      {
        name: "address",
        title: "Address",
        component: () => (
          <InputCustomize
            title="Address"
            icon={() => <HomeRounded color="primary" />}
          />
        ),
      },
      {
        name: "email",
        title: "Email",
        component: () => (
          <InputCustomize
            title="Email"
            icon={() => <AccountCircle color="primary" />}
          />
        ),
      },
      {
        name: "phone",
        title: "Phone",
        component: () => (
          <InputCustomize
            title="Phone"
            icon={() => <PhoneAndroidRounded color="primary" />}
          />
        ),
      },
    ],
  },
//   {
//     section: "Social Media",
//   },
//   {
//     section: "Infomation",
//   },
];
